import Layout from "../components/layout/layout";

function Favorite() {
  const position = { container: "w-11/12 m-auto *my-5" };
  return (
    <Layout>
      <div className={position.container}>
        <Heading>Favorite</Heading>
        <Subheading>Similar Products</Subheading>
      </div>
    </Layout>
  );
}

function Heading(props) {
  const design = "font-medium text-2xl";
  return <h1 className={design}>{props.children}</h1>;
}

function Subheading(props) {
  const design = "text-xl";
  return <h2 className={design}>{props.children}</h2>;
}

export default Favorite;
